import React from "react";

const Steps = () => {
  const steps = [
    "Step 1: Upload XPT",
    "Step 2: Domain Prediction",
    "Step 3: SDTM Mapping",
    "Step 4: Mapping QC",
    "Step 5: Function Mapping",
    "Step 6: Download",
  ];

  return (
    <div className="flex gap-6 mt-5 border-b pb-2">
      {steps.map((step, index) => (
        <span key={index} className="cursor-pointer text-gray-600 hover:text-red-500 border-b-2 border-transparent hover:border-red-500">
          {step}
        </span>
      ))}
    </div>
  );
};

export default Steps;
